  true,\n\t\"url\": null,\n\t\"notes\": \"This is the Department of Veterans Affairs,
  Freedom of Information Act (FOIA) Report for Fiscal Year 2009.  The report contains
  metrics on FOIA requests received, processed, and pending by agency/component.  It
  also contains metrics on exemptions, appeals, consultations, response times, and
  backlogs.  Fees collected, fees waived, and FOIA personnel and costs are reported.
  \ Comparison of metrics attained for the previous year is also included.\",\n\t\"license_title\":
